import React, {Component} from 'react';
import "../sass/Checklist.scss";
import { Grid } from '@material-ui/core';
class Checklist extends Component {

    state = {
        data: [
            count = 0
        ]
    };

  render() {
      return (
        <div>
            <div>線上簽到系統</div>
            <Grid container spacing={3}>
                <Grid item xs={2}  className="day">
                    <div className="button-name">第一天</div>
                    <button type="button">
                        <img src="/image/question.png" className="check-in" />
                    </button>
                </Grid>

                <Grid item xs={2}  className="day">
                    <div>第二天</div>
                        <button type="button">
                            <img src="/image/question.png" className="check-in" />
                        </button>
                </Grid>

                <Grid item xs={2}  className="day">
                    <div>第三天</div>
                    <button type="button">
                        <img src="/image/question.png" className="check-in" />
                    </button>
                </Grid>

            </Grid>
            <div>
                簽到總和：<div>{ count }</div>
            </div>
        </div>
      );
  }
}

export default Checklist;
